1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 315.61 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 398 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 6343.88 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 18.45 s &lt;/li&gt;\n&lt;li&gt; transfer time: 497.31 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.155:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 4 &lt;/li&gt;\n          &lt;li&gt; Threads: 96 &lt;/li&gt;\n          &lt;li&gt; Memory: 690.94 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr, timeout=60, heartbeat_interval=10)\n    return client\n\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n# Get client\nclient = connect(scheduler_info)\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"formatter":{"id":"1432"},"group":null,"major_label_policy":{"id":"1433"},"ticker":{"id":"1013"},"visible":false},"id":"1012","type":"LinearAxis"},{"attributes":{},"id":"1010","type":"LinearScale"},{"attributes":{},"id":"1507","type":"Selection"},{"attributes":{"coordinates":null,"group":null},"id":"1413","type":"Title"},{"attributes":{},"id":"1013","type":"BasicTicker"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"dimensions":"width"},"id":"1142","type":"PanTool"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{},"id":"1008","type":"LinearScale"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Pan
